import React from "react";

function ExpenseItem() {
  return (
    <>
      <div>March 28th 2021</div>
      <div>
        <h2>Car insurance</h2>
        <div>$284.22</div>
      </div>
    </>
  );
}

export default ExpenseItem;

const products = [
  { title: 'blab', description: 'bababa', price: 255.33 },
  { title: 'blabebeb', description: '3bebe', price: 55.33 }
]
